package com.example.net

import com.example.net.activity.MainActivity
import com.google.gson.Gson
import com.google.gson.JsonElement
import com.google.gson.JsonObject
import org.json.JSONException
import java.security.SecureRandom
import java.util.Base64
import javax.crypto.Cipher
import javax.crypto.spec.GCMParameterSpec
import javax.crypto.spec.SecretKeySpec

object Test2 {
    private val KEY_AES = "AES"
    private val ALGORTHIM = "AES/GCM/NoPadding"
    private val T_LEN = 128

    private fun decryptAES(key: ByteArray, iv: ByteArray, tag: ByteArray, text: ByteArray): String {
        val secretKeySpec =
            SecretKeySpec(key, KEY_AES)
        val cipher = Cipher.getInstance(ALGORTHIM)
        val spec = GCMParameterSpec(T_LEN, iv)
        cipher.init(Cipher.DECRYPT_MODE, secretKeySpec, spec)
        return String(cipher.doFinal(text + tag))
    }


    fun decryptAESFromBase64(
        input: String?,
        ivBase64: String?,
        tagBase64: String?
    ): String {
        input ?: return ""
        ivBase64 ?: return ""
        tagBase64 ?: return ""
        try {

            val keyBytes = MainActivity.keyOfTheEncryption.toByteArray()
            val iv = Base64.getDecoder().decode(ivBase64.toByteArray())
            val tag = Base64.getDecoder().decode(tagBase64.toByteArray())
            val text = Base64.getDecoder().decode(input.toByteArray())
            return decryptAES(keyBytes, iv, tag, text)
        } catch (_: JSONException) {
        }
        return ""
    }


    fun encrypt(
        data: String,
    ): Map<String, String> {
        val cipher = Cipher.getInstance("AES/GCM/NoPadding")
        val secureRandom = SecureRandom()

        val iv = ByteArray(12)
        secureRandom.nextBytes(iv)
        val key = SecretKeySpec(MainActivity.keyOfTheEncryption.toByteArray(), KEY_AES)

        val parameterSpec = GCMParameterSpec(128, iv)
        cipher.init(Cipher.ENCRYPT_MODE, key, parameterSpec)
        val encryptedData = cipher.doFinal(data.toByteArray(Charsets.UTF_8))

        val tag = encryptedData.copyOfRange(encryptedData.size - 16, encryptedData.size)
        val ciphertextWithoutTag = encryptedData.copyOfRange(0, encryptedData.size - 16)

        val ivBase64 = Base64.getEncoder().encodeToString(iv)
        val tagBase64 = Base64.getEncoder().encodeToString(tag)
        val ciphertextBase64 = Base64.getEncoder().encodeToString(ciphertextWithoutTag)

        return mapOf("iv" to ivBase64, "tag" to tagBase64, "ciphertext" to ciphertextBase64)
    }
}

fun generateRandomString(length: Int = 32): String {
    val characters = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789"
    val secureRandom = SecureRandom()
    return (1..length).map {
        characters[secureRandom.nextInt(characters.length)]
    }.joinToString("")
}


fun main() {
    Test2.decryptAESFromBase64(
        input = "",
        ivBase64 = "feaMa2RS76stJHlk",
        tagBase64 = "Dltp8sXUtRF+0jIvyr6YMw=="
        ).apply(::println)

}
